import string
class Solution:
    result = ''
    def longestDupSubstring(self, s) -> str:
        n = len(s)
        if n < 2:
            return ''
        letters = string.ascii_lowercase
        _map = {letters[i]: i + 1 for i in range(26)}
        mod = 2**63 - 1
        p = 26
        _pow = [1] * (n+1)
        for i in range(1, n+1):
            _pow[i] = (_pow[i-1] * p) % mod

        def rabin_karp(m):
            h = 0
            for i in range(m):
                h = (h * p + _map[s[i]]) % mod
            d = {h}
            for i in range(1, n - m + 1):
                h = ((h - _map[s[i-1]] * _pow[m-1]) * p + _map[s[i + m - 1]]) % mod
                if h not in d:
                    d.add(h)
                else:
                    return True, s[i: i + m]
            return False, ''

        def biSearch(low, high):
            if low > high:
                return
            mid = (low + high) // 2
            ans = rabin_karp(mid)
            if ans[0]:
                self.result = ans[1]
                biSearch(mid + 1, high)
            else:
                biSearch(low, mid - 1)

        biSearch(1, n - 1)
        return self.result


s = Solution()
print(s.longestDupSubstring("bananas"))
print(s.longestDupSubstring(""))
